import React from "react";
import { Swiper, SwiperSlide, Navigation, Pagination, Scrollbar } from 'swiper/react';
import 'swiper/css';
import { NavBar } from "./Components/Header/Header";
import { Introduction } from "./Components/Introduction/Intro";
import { SelectedWorks } from "./Components/Selected Works/selected";
import './index.css'
const Structure = () => {
    return (
        <>
            <div className="Body">
                <NavBar />
                <Introduction />
            </div>
            <Swiper
                spaceBetween={50}
                slidesPerView={1}
                navigation
                pagination={{ clickable: true }}
                scrollbar={{ draggable: true }}
            >
                <SwiperSlide>
                    <SelectedWorks />
                </SwiperSlide>
                ...
            </Swiper>
        </>
    )
}

export { Structure }
